import React from 'react'
import { NavLink } from 'react-router-dom';
import './NBar.css';

const NavBar = () => {
  return (
    <>
    <div className='div_center'>
      <div class="hamburger-menu">
   <NavLink exact activeClassName = 'active_class' className='navlink' to="/">About us</NavLink>
<NavLink exact activeClassName = 'active_class'  className='navlink' to="/contact">Contact us</NavLink>
<NavLink exact activeClassName = 'active_class'  className='navlink' to="/user/sajjad/khan">User</NavLink>
<NavLink exact activeClassName = 'active_class'  className='navlink' to="/search">Search</NavLink>
<NavLink exact activeClassName = 'active_class'  className='navlink' to="/error">Error</NavLink>
    <br />
      {/* <a href="/"> Aboutpage </a>
      <a href="/contact"> Conactpage </a> */}
      </div>
      </div>
    </>
  )
}

export default NavBar
